import React from "react";
import "./Pages/styles/Selector.css"


function SoftnessSelector() {
    return (
        <>
            <div className="radio">
                <input className="radio__input" type="radio" value="option1" name="myRadio" id="myRadio1"/>
                <label className="radio__label" for="myRadio1"> Firm Deadline</label>
                <input className="radio__input" type="radio" value="option1" name="myRadio" id="myRadio2"/>
                <label className="radio__label" htmlFor="myRadio2"> Soft Deadline</label>
            </div>
        </>
    )
}

export default SoftnessSelector;
